import React from 'react'
import {
  Redirect,
  Route,
  Switch
} from 'react-router-dom'
import Components from "/Home/Components.js";


  

const index = () => {
  return (
          <Switch>
                <Route
                  path='/'
                  exact
                  render={props => (
                      <Components {...props} />
                  )} />


            <Redirect from="/admin" to="/admin/dashboard" />
          </Switch>
  )
}

export default index
